create table utenti (
    id       int auto_increment
        primary key,
    email    varchar(40)                                          not null,
    password varchar(40)                                          not null,
    nome     varchar(40)                                          not null,
    tipo     enum ('Normale', 'Amministratore') default 'Normale' not null,
    constraint email
        unique (email)
);

