create table sottocategorie (
    id        int auto_increment
        primary key,
    categoria int         not null,
    nome      varchar(50) not null,
    immagine  int         not null,
    constraint nome
        unique (nome),
    constraint sottocategorie_ibfk_1
        foreign key (categoria) references categorie (id)
            on update cascade,
    constraint sottocategorie_ibfk_2
        foreign key (immagine) references immagini (id)
            on update cascade
);

create index categoria
    on sottocategorie (categoria);

create index img
    on sottocategorie (immagine);

